import React from 'react'
import { businessLinks } from '../constants'
import style from '../style'


const Business = () => {
  return (
    <div className=''>
      <ul className='flex flex-row'>
      {
        businessLinks.map((business,index) => (
          <li className='font-medium text-[30px]'>{business.type}
          <img src = {business.image} alt = "cuisinetype" className='w-[40px] h-[40px]'/>
          <p className={style.paragraph}>{business.content}</p>
          </li>
        ))
      }
      </ul>
    </div>
  )
}

export default Business
